import React from 'react'
import {TiShoppingCart} from 'react-icons/ti'
import App from "./App"

export default function ListGames({ game, onClick }) {
    return (
        <div>
            <span>{game} </span>
            <a>
                <TiShoppingCart
                    style={{ cursor: "pointer" }}
                    onClick={() => addToCart(game)}
                />
                </a>
        </div>
    )
}
